import React, { useState } from 'react';
import Profile from './Profile';
import FeePayment from './FeePayment';
import Attendance from './Attendance';
import Results from './Results';
import Courses from './Courses';
import Placements from './Placements';
import ExamTimeTable from './ExamTimeTable';
import AdmitCard from './AdmitCard';
import Grievances from './Grievances';
import TimeTable from './TimeTable';

function Dashboard({ onLogout }) {
  const [activeTab, setActiveTab] = useState('home');

  const announcements = [
    { id: 1, title: "Techno Cultural Fest", content: "Exciting events coming soon!", date: "2024-02-15" },
    { id: 2, title: "Mid-Semester Examinations", content: "Exams start in 12 days.", date: "2024-02-20" },
  ];

  const renderContent = () => {
    switch (activeTab) {
      case 'profile': return <Profile />;
      case 'attendance': return <Attendance />;
      case 'results': return <Results />;
      case 'timetable': return <TimeTable />;
      case 'courses': return <Courses />;
      case 'placements': return <Placements />;
      case 'examtimetable': return <ExamTimeTable />;
      case 'admitcard': return <AdmitCard />;
      case 'grievances': return <Grievances />;
      case 'feepayment': return <FeePayment />;
      default: return (
        <div className="bg-white p-5 rounded-lg shadow">
          <h1 className="text-2xl font-bold mb-4">Welcome to the Dashboard</h1>
          <div className="announcements">
            <h2 className="text-xl font-semibold mb-3">Announcements</h2>
            <ul>
              {announcements.map(announcement => (
                <li key={announcement.id} className="mb-3">
                  <h3 className="font-bold">{announcement.title}</h3>
                  <p>{announcement.content}</p>
                  <span className="text-gray-500 text-sm">{announcement.date}</span>
                </li>
              ))}
            </ul>
          </div>
        </div>
      );
    }
  };

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <div className="w-64 bg-gray-200 text-black p-5 flex flex-col h-full">
        <button
          className={`py-2 px-4 rounded-lg mb-2 ${activeTab === 'home' ? 'bg-blue-300' : 'hover:bg-blue-200'}`}
          onClick={() => setActiveTab('home')}
        >
          Home
        </button>
        <button
          className={`py-2 px-4 rounded-lg mb-2 ${activeTab === 'profile' ? 'bg-blue-300' : 'hover:bg-blue-200'}`}
          onClick={() => setActiveTab('profile')}
        >
          Profile
        </button>
        <button
          className={`py-2 px-4 rounded-lg mb-2 ${activeTab === 'attendance' ? 'bg-blue-300' : 'hover:bg-blue-200'}`}
          onClick={() => setActiveTab('attendance')}
        >
          Attendance
        </button>
        <button
          className={`py-2 px-4 rounded-lg mb-2 ${activeTab === 'results' ? 'bg-blue-300' : 'hover:bg-blue-200'}`}
          onClick={() => setActiveTab('results')}
        >
          Results
        </button>
        <button
          className={`py-2 px-4 rounded-lg mb-2 ${activeTab === 'timetable' ? 'bg-blue-300' : 'hover:bg-blue-200'}`}
          onClick={() => setActiveTab('timetable')}
        >
          Time Table
        </button>
        <button
          className={`py-2 px-4 rounded-lg mb-2 ${activeTab === 'courses' ? 'bg-blue-300' : 'hover:bg-blue-200'}`}
          onClick={() => setActiveTab('courses')}
        >
          Courses
        </button>
        <button
          className={`py-2 px-4 rounded-lg mb-2 ${activeTab === 'placements' ? 'bg-blue-300' : 'hover:bg-blue-200'}`}
          onClick={() => setActiveTab('placements')}
        >
          Placements
        </button>
        <button
          className={`py-2 px-4 rounded-lg mb-2 ${activeTab === 'examtimetable' ? 'bg-blue-300' : 'hover:bg-blue-200'}`}
          onClick={() => setActiveTab('examtimetable')}
        >
          Exam Time Table
        </button>
        <button
          className={`py-2 px-4 rounded-lg mb-2 ${activeTab === 'admitcard' ? 'bg-blue-300' : 'hover:bg-blue-200'}`}
          onClick={() => setActiveTab('admitcard')}
        >
          Admit Card
        </button>
        <button
          className={`py-2 px-4 rounded-lg mb-2 ${activeTab === 'grievances' ? 'bg-blue-300' : 'hover:bg-blue-200'}`}
          onClick={() => setActiveTab('grievances')}
        >
          Grievances
        </button>
        <button
          className={`py-2 px-4 rounded-lg mb-2 ${activeTab === 'feepayment' ? 'bg-blue-300' : 'hover:bg-blue-200'}`}
          onClick={() => setActiveTab('feepayment')}
        >
          Fee Payment
        </button>
        <button
          className="mt-auto py-2 px-4 bg-red-500 text-white rounded-lg hover:bg-red-600"
          onClick={onLogout}
        >
          Logout
        </button>
      </div>

      {/* Main Content */}
      <div className="flex-grow p-5 overflow-y-auto">
        <div className="min-h-full">{renderContent()}</div>
      </div>
    </div>
  );
}

export default Dashboard;
